import React from 'react';
import { Header } from 'semantic-ui-react';
import { Link } from 'react-router-dom';


const HeaderApp = (props) => {
  return (
    <Header>
      <ul>
        <li><Link to="/">Login</Link></li>
        <li onClick={props.logOut}>Logout</li>
      </ul>
    </Header>
    )
}

export default HeaderApp;
